description:
Category	Feature, Couples

Director	James Avalon
Starring	Jodi Taylor, Xander Corvus, Steven St Croix, Adriana Chechik, Van Wylde, Karla Kush

Getting together for the holidays can be nerve wrecking! Especially when you have two sisters vying for attention. Daddy's love and the same boyfriends. Starring Jodi Taylor and Karla Kush as the dueling sisters, Adriana Chechik as Daddy's Crush. Xander Corvus and Van Wylde as the men they're fighting over and Steven St. Croix and Kylie Ireland as the Mom and Dad.
